from flask import Flask, render_template

app=Flask(__name__)

@app.route('/')
def index():
    return render_template('index.html')

@app.route('/profile/<username>')
def profile(username):
    return render_template('profile.html',username=username,isActive=False)
@app.route('/books')
def books():
    books=[{'name':'A Tale of Two Cities','author':'Charles Dickens','cover':'data:image/jpeg;base64,'},{'name':'The Little Prince (Le Petit Prince)','author':'Antoine de Saint-Exupéry','cover':'data:image/jpeg;base64,'},{'name':'Harry Potter and the Philosophers Stone','author':'J. K. Rowling','cover':'data:image/jpeg;base64,'}]
    return render_template('books.html',books=books)

app.run(debug=True)

